        <Link to="/weekly-planner" className="nav-link">Weekly Planner</Link>
        
        {/* Grocery Lists Dropdown */}
        <div className="dropdown">
          <button className="dropbtn">Grocery Lists ‚ñº</button>
          <div className="dropdown-content">
            <Link to="/weekly-planner">üóìÔ∏è Create from Meal Plan</Link>
            <Link to="/saved-grocery-lists">üìù View Saved Lists</Link>
          </div>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
